import React from "react";
import "./Navigation.css";

const Navigation = () => {
	return (
		(
			<nav>
				<p className="f3 link dim black underline pa3 pointer">Sign Out</p>
			</nav>
		),
		(<h1>SMARTBRAIN</h1>)
	);
};

export default Navigation;
